import "../homepage/homepage.css"

import Header from '../header/header';

const Cart = ({setLoginUser}) => {
  return (
    <div className="Homepage">
    <Header />
    <h1>Welcome To Cart Page</h1>
    </div>
  )
}

export default Cart
